import {
  Theme,
  createStyles
} from "@material-ui/core/styles";

const styles = (theme: Theme) => createStyles({
  cardRoot: {
    // Temporary
    width: 235,

    height: 234,
    borderRadius: 12,
    padding: 10,
  },
  cardContentRoot: {
    padding: 10,
  }
})

export default styles
